        { id: "tooth-270", tooth_num: 34, parts: [ { id: 1, svg: `<path d="M 1240.5,356.5 C 1260.64,369.718 1280.81,369.718 1301,356.5C 1299.28,377.238 1296.61,397.904 1293,418.5C 1287.51,444.441 1282.35,470.441 1277.5,496.5C 1278.73,501.466 1280.4,506.299 1282.5,511C 1280.52,519.403 1275.52,521.736 1267.5,518C 1262.33,512.835 1258.83,506.668 1257,499.5C 1255.08,491.218 1253.41,482.885 1252,474.5C 1248.08,435.16 1244.24,395.826 1240.5,356.5 Z" fill="#fdfdfd" style="opacity:1"/>` } ] }
      ],
