  },

  computed: {
    filteredCaseCategories() {
      if (!this.categorySearchTerm) {
        return this.caseCategories;
      }
      const searchTerm = this.categorySearchTerm.toLowerCase();
      return this.caseCategories.filter(category => 
        category.toLowerCase().includes(searchTerm)
      );
    }
  },

  methods: {
    /**
     * Filter categories based on search term
     */
    filterCategories() {
      // The computed property handles filtering automatically
    },
    
    /**
     * Check if a tooth number has an active category
     * Consolidates all category checks in one place
     */
    isToothActive(toothNumber) {
      // Check if tooth has a manually assigned category
      const hasManualCategory = this.toothCategories.has(`tooth-${toothNumber}`) || 
                                this.selectedCases.some(c => String(c.toothNum) === String(toothNumber));
      
      // Check if tooth has an existing patient case from API
      const hasExistingCase = this.patientCases && this.patientCases.some(patientCase => 
        this.isToothInCase(patientCase, toothNumber)
      );
      
      return hasManualCategory || hasExistingCase;
    },

    /**
     * Helper: Check if a tooth number exists in a patient case
     */
    isToothInCase(patientCase, toothNumber) {
      // Get all possible tooth number formats for this display number
      const possibleNumbers = this.getAllToothNumberFormats(toothNumber);
      
      // Check tooth_number field (single number)
      if (patientCase.tooth_number) {
        const caseNumber = parseInt(patientCase.tooth_number);
        if (possibleNumbers.includes(caseNumber)) return true;
      }
      
      // Check tooth_num field (array format)
      if (patientCase.tooth_num) {
        const toothNumbers = this.parseToothNumbers(patientCase.tooth_num);
        if (toothNumbers.some(num => possibleNumbers.includes(num))) return true;
      }
      
      return false;
    },

    /**
     * Helper: Get all possible formats for a tooth number
     */
    getAllToothNumberFormats(toothNumber) {
      const mappedNumbers = this.getToothNumbersMapping(toothNumber);
      return [toothNumber, ...mappedNumbers];
    },

    /**
     * Helper: Parse tooth numbers from various formats
     */
    parseToothNumbers(toothNumString) {
      try {
        // Try JSON parse first (e.g., "[42]")
        const parsed = JSON.parse(toothNumString);
        return Array.isArray(parsed) ? parsed : [parsed];
      } catch (e) {
        // Fallback: parse as comma-separated string
        return toothNumString
          .replace(/[[\]]/g, '')
          .split(',')
          .map(num => parseInt(num.trim()))
          .filter(num => !isNaN(num));
      }
    },

    /**
     * Select a category for the clicked tooth
     * Makes the tooth label active and stores the selection
     */
    selectCaseCategory(category) {
      const { toothNum, toothId } = this.contextMenu;
      
      if (!toothNum) {
        console.warn('No tooth number found for category selection');
        return;
      }
      
      // Remove any existing category for this tooth
      this.removeCategoryForTooth(toothNum);
      
      // Create new case entry
      const newCase = {
        toothNum: String(toothNum),
        toothId: toothId,
        category: category,
        timestamp: Date.now() // Add timestamp for tracking
      };
      
      // Store in both data structures for redundancy
      this.selectedCases.push(newCase);
      this.toothCategories.set(`tooth-${toothNum}`, {
        toothNumber: toothNum,
        category: category
      });
      
      // Clean up and emit
      this.hideContextMenu();
      this.emitCaseSelection();
      
      console.log('Category assigned:', {
        tooth: toothNum,
        category: category,
        totalCases: this.selectedCases.length
      });
      
      // Force reactivity update
      this.$forceUpdate();
    },

    /**
     * Remove category from a specific tooth
     */
    removeCategory() {
      const { toothNum, toothId } = this.contextMenu;
      
      if (!toothNum) {
        console.warn('No tooth number found for category removal');
        return;
      }
      
      this.removeCategoryForTooth(toothNum);
      this.hideContextMenu();
      this.emitCaseSelection();
      
      console.log('Category removed from tooth:', toothNum);
    },

    /**
     * Helper: Remove category for a specific tooth
     */
    removeCategoryForTooth(toothNum) {
      // Remove from selectedCases array
      this.selectedCases = this.selectedCases.filter(
        c => String(c.toothNum) !== String(toothNum)
      );
      
      // Remove from toothCategories map
      const toothId = `tooth-${toothNum}`;
      this.toothCategories.delete(toothId);
    },

    /**
     * Helper: Emit case selection event to parent
     */
    emitCaseSelection() {
      this.$emit('case-selected', {
        cases: this.selectedCases,
        categories: Array.from(this.toothCategories.entries()).map(([id, data]) => ({
          toothId: id,
          ...data
        }))
      });
    },

    /**
     * Check if a tooth label should be active
     */
    isLabelActive(labelId) {
      return this.selectedCases.some(
        c => String(c.toothNum) === String(labelId)
      );
    },

    /**
     * Get category for a specific tooth (useful for display)
     */
    getToothCategory(toothNum) {
      const caseEntry = this.selectedCases.find(
        c => String(c.toothNum) === String(toothNum)
      );
      return caseEntry ? caseEntry.category : null;
    },

    /**
     * Clear all selected cases (optional utility method)
     */
    clearAllCases() {
      this.selectedCases = [];
      this.toothCategories.clear();
      this.emitCaseSelection();
    },

    // ...existing code (all other methods remain unchanged)...
    /**
     * Copy tooth ID to clipboard when clicking on tooth
     */
    copyToothIdOnClick(toothId) {
      // Find the tooth data
      const tooth = this.teeth.find(t => t.id === toothId);
      if (!tooth) return;

      // Use tooth_num if available, otherwise use tooth id
      const idToCopy =  toothId;

      // Copy to clipboard
      if (navigator.clipboard && navigator.clipboard.writeText) {
        navigator.clipboard.writeText(idToCopy.toString())
          .then(() => {
            console.log(`Tooth ID ${idToCopy} copied to clipboard`);
            this.showCopyToast(idToCopy);
          })
          .catch(err => {
            console.error('Failed to copy tooth ID:', err);
            this.fallbackCopyToClipboard(idToCopy.toString());
          });
      } else {
        // Fallback for older browsers
        this.fallbackCopyToClipboard(idToCopy.toString());
      }
    },

    /**
     * Show toast notification
     */
    showCopyToast(toothId) {
      this.copiedToothId = toothId;
      this.showToast = true;

      // Hide toast after 2 seconds
      setTimeout(() => {
        this.showToast = false;
      }, 2000);
    },

    // Fallback copy method for older browsers
    fallbackCopyToClipboard(text) {
      const textArea = document.createElement('textarea');
      textArea.value = text;
      textArea.style.position = 'fixed';
      textArea.style.left = '-999999px';
      document.body.appendChild(textArea);
      textArea.select();

      try {
        document.execCommand('copy');
        console.log(`Tooth ID ${text} copied to clipboard (fallback)`);
        this.showCopyToast(text);
      } catch (err) {
        console.error('Fallback copy failed:', err);
      }

      document.body.removeChild(textArea);
    },

    /**
     * Select a tooth by clicking on it
     */
    selectTooth(id) {
      this.selectedTooth = id;
      console.log('Selected tooth:', id);
    },

    /**
     * Handle clicking on a tooth part
     */
    selectPart(toothId, partId, tooth_num) {
      this.selectedTooth = toothId;
      // Copy tooth ID to clipboard
      const idToCopy = tooth_num || toothId;
      this.copyToothIdOnClick(toothId);

      console.log('Selected tooth part:', toothId, partId);
    },

    /**
     * Handle clicking on a tooth path (custom method for clipboard copy)
     */
    handlePathClick(path, index, event) {
      // Copy tooth ID to clipboard first
      const actualToothNumber = this.getToothNumberFromIndex(index);
      this.copyToothIdOnClick(actualToothNumber);

      // ...existing tooth selection code...
      // You may want to call selectTooth or selectPart here if needed
    },

    // Helper method to get tooth number from path index
    getToothNumberFromIndex(pathIndex) {
      // Use the same mapping logic as teethv3.vue
      const allToothNumbers = [
        ...(this.topTeethNumbers || []),
        ...(this.bottomTeethNumbers || [])
      ];

      return allToothNumbers[pathIndex] || pathIndex;
    },

    /**
     * Handle left-click on tooth
     */
    handleClick(event) {
      this.clearSelection();
      this.selectToothFromEvent(event, 'click');
    },

    /**
     * Handle right-click on tooth - show category menu
     */
    handleContextMenu(event) {
      this.selectToothFromEvent(event, 'contextmenu');
    },

    /**
     * Select tooth from event (works for both click and right-click)
     */
    selectToothFromEvent(event, eventType) {
      event.preventDefault();
      event.stopPropagation();
      
      let target = event.target;
      let toothElement = null;
      
      // Traverse up the DOM tree to find tooth group
      let maxDepth = 15;
      let currentDepth = 0;
      
      while (target && target !== event.currentTarget && currentDepth < maxDepth) {
        // Check if current element is a tooth group with ID
        if (target.tagName === 'g' && target.id && target.id.startsWith('tooth-')) {
          toothElement = target;
          break;
        }
        
        // Also check if parent has the tooth ID
        if (target.parentElement && target.parentElement.tagName === 'g' && 
            target.parentElement.id && target.parentElement.id.startsWith('tooth-')) {
          toothElement = target.parentElement;
          break;
        }
        
        target = target.parentElement;
        currentDepth++;
      }
      
      if (!toothElement) {
        console.log('No tooth element found');
        return;
      }
      
      const toothId = toothElement.id;
      let toothNum = toothElement.getAttribute('data-tooth-num');
      const tooth = this.teeth.find(t => t.id === toothId);
      
      if (!tooth) {
        console.log('No tooth data found for:', toothId);
        return;
      }
      
      // Get tooth number from data attribute or tooth object
      if (!toothNum && tooth.tooth_num) {
        toothNum = tooth.tooth_num;
      }
      
      // Fallback: extract from ID
      if (!toothNum) {
        toothNum = toothId.replace('tooth-', '');
      }
      
      if (eventType === 'click') {
        // Left-click: Select tooth and copy ID
        this.selectedTooth = toothId;
        this.copyToothIdOnClick(toothId);
        console.log('Selected tooth:', toothId, 'Number:', toothNum);
      } else if (eventType === 'contextmenu') {
        // Right-click: Show category menu
        // Find the SVG element to get proper coordinates
        let svgElement = event.currentTarget;
        while (svgElement && svgElement.tagName !== 'svg') {
          svgElement = svgElement.parentElement;
        }
        
        if (!svgElement) {
          console.warn('SVG element not found');
          return;
        }
        
        const svgRect = svgElement.getBoundingClientRect();
        
        // Menu dimensions
        const menuWidth = 280;
        const menuHeight = 400;
        const offset = 10;
        
        // Use absolute positioning (clientX/clientY are already screen coordinates)
        let menuX = event.clientX;
        let menuY = event.clientY + offset; // Default: below cursor
        
        // Check if menu would go off bottom of screen
        if (menuY + menuHeight > window.innerHeight) {
          menuY = event.clientY - menuHeight - offset; // Position above cursor
        }
        
        // Center horizontally on cursor
        menuX = menuX - (menuWidth / 2);
        
        // Check if menu would go off right edge
        if (menuX + menuWidth > window.innerWidth) {
          menuX = window.innerWidth - menuWidth - 10;
        }
        
        // Check if menu would go off left edge
        if (menuX < 10) {
          menuX = 10;
        }
        
        // Final check for top edge
        if (menuY < 10) {
          menuY = 10;
        }
        
        this.contextMenu.x = menuX;
        this.contextMenu.y = menuY;
        this.contextMenu.toothId = toothId;
        this.contextMenu.partId = tooth.parts[0].id;
        this.contextMenu.toothNum = toothNum;
        this.contextMenu.visible = true;
        
        console.log('Right-clicked tooth:', toothId);
        console.log('Tooth number:', toothNum);
        console.log('Menu position:', this.contextMenu.x, this.contextMenu.y);
      }
    },

    /**
     * Clear selection and hide context menu
     */
    clearSelection() {
      this.selectedTooth = null;
      this.hideContextMenu();
    },

    /**
     * Hide context menu
     */
    hideContextMenu() {
      this.contextMenu.visible = false;
      this.contextMenu.toothId = null;
      this.contextMenu.partId = null;
      this.contextMenu.toothNum = null;
    }
  },
};


